import React, { useState, useRef } from "react";
import { Dialog } from "primereact/dialog";
import { Button } from "primereact/button";
import { InputText } from "primereact/inputtext";
import { Password } from "primereact/password";
import { Toast } from "primereact/toast";
import "primereact/resources/themes/lara-light-teal/theme.css";

const RegistroUsuarioModal = () => {
  const [visible, setVisible] = useState(false);
  const [formData, setFormData] = useState({
    cedula: "",
    nombre: "",
    primerApellido: "",
    segundoApellido: "",
    direccion: "",
    telefono: "",
    correoElectronico: "",
    contrasena: "",
  });

  const toast = useRef(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    if (Object.values(formData).some((value) => value.trim() === "")) {
      toast.current.show({
        severity: "warn",
        summary: "Campos vacíos",
        detail: "Por favor, completa todos los campos",
        life: 3000,
      });
      return;
    }

    console.log("Datos enviados:", formData);

    setFormData({
      cedula: "",
      nombre: "",
      primerApellido: "",
      segundoApellido: "",
      direccion: "",
      telefono: "",
      correoElectronico: "",
      contrasena: "",
    });

    toast.current.show({
      severity: "success",
      summary: "Registro exitoso",
      detail: "El usuario se ha registrado correctamente",
      life: 3000,
    });

    setVisible(false);
  };

  const customStyles = {
    dialog: {
      width: '50vw',
      maxWidth: '600px',
    },
    container: {
      padding: '2rem',
    },
    field: {
      marginBottom: '1.5rem',
    },
    label: {
      display: 'block',
      marginBottom: '0.5rem',
      color: '#374151',
      fontSize: '0.875rem',
      fontWeight: '500',
    },
    input: {
      width: '100%',
      '&:focus': {
        borderColor: '#0D9488',
        boxShadow: '0 0 0 2px rgba(13, 148, 136, 0.2)',
      },
    },
    button: {
      backgroundColor: '#0D9488',
      border: 'none',
      '&:hover': {
        backgroundColor: '#0F766E',
      },
    },
  };

  const renderFooter = () => {
    return (
      <div>
        <Button
          label="Cancelar"
          icon="pi pi-times"
          onClick={() => setVisible(false)}
          className="p-button-text"
        />
        <Button
          label="Registrar"
          icon="pi pi-check"
          onClick={handleSubmit}
          style={customStyles.button}
          className="p-button-success"
        />
      </div>
    );
  };

  const InputField = ({ id, label, type = "text", ...props }) => (
    <div style={customStyles.field}>
      <label htmlFor={id} style={customStyles.label}>
        {label}
      </label>
      {type === "password" ? (
        <Password
          id={id}
          toggleMask
          className="w-full"
          inputClassName="w-full"
          style={customStyles.input}
          {...props}
        />
      ) : (
        <InputText
          id={id}
          type={type}
          className="w-full"
          style={customStyles.input}
          {...props}
        />
      )}
    </div>
  );

  return (
    <div>
      <Toast ref={toast} />
      <Button
        label="Registrar Usuario"
        icon="pi pi-user-plus"
        onClick={() => setVisible(true)}
        style={customStyles.button}
      />
      
      <Dialog
        header="Registro de Usuario"
        visible={visible}
        style={customStyles.dialog}
        onHide={() => setVisible(false)}
        footer={renderFooter()}
        className="p-fluid"
      >
        <div style={customStyles.container}>
          <InputField
            id="cedula"
            name="cedula"
            label="Cédula"
            value={formData.cedula}
            onChange={handleInputChange}
          />
          <InputField
            id="nombre"
            name="nombre"
            label="Nombre"
            value={formData.nombre}
            onChange={handleInputChange}
          />
          <InputField
            id="primerApellido"
            name="primerApellido"
            label="Primer Apellido"
            value={formData.primerApellido}
            onChange={handleInputChange}
          />
          <InputField
            id="segundoApellido"
            name="segundoApellido"
            label="Segundo Apellido"
            value={formData.segundoApellido}
            onChange={handleInputChange}
          />
          <InputField
            id="direccion"
            name="direccion"
            label="Dirección"
            value={formData.direccion}
            onChange={handleInputChange}
          />
          <InputField
            id="telefono"
            name="telefono"
            label="Teléfono"
            value={formData.telefono}
            onChange={handleInputChange}
          />
          <InputField
            id="correoElectronico"
            name="correoElectronico"
            label="Correo Electrónico"
            type="email"
            value={formData.correoElectronico}
            onChange={handleInputChange}
          />
          <InputField
            id="contrasena"
            name="contrasena"
            label="Contraseña"
            type="password"
            value={formData.contrasena}
            onChange={handleInputChange}
          />
        </div>
      </Dialog>
    </div>
  );
};

export default RegistroUsuarioModal;
